import React from 'react';
import {Route} from 'react-router-dom'
import Home from './routes/Home'
import Test from './routes/Test'


function App() {
  return (
    <div>
      <Route path="/" component={Home}/>
      <Route path="/test" component={Test}/>
      </div>
  );
}

export default App;
